import { createSlice } from "@reduxjs/toolkit";

const AddOnSlice = createSlice({
    name: "addon",
    initialState: [{
        img: "data:image/jpeg;base64,",
        name: "	High-End Gaming PC (4090/240 Hz monitor)",
        cost: 200,
        quantity: 0,
    },
    {
        img: "data:image/jpeg;base64,",
        name: "Console Station (PS5 or Xbox Series X, 55â€³ 4K TV)",
        cost: 35,
        quantity: 0,
    },
    {
        img: "data:image/jpeg;base64,",
        name: "	VR Headset Kit (Meta Quest 3 + controllers)",
        cost: 45,
        quantity: 0,
    },
    {
        img: "data:image/jpeg;base64,",
        name: "RGB Lighting & Fog Pack",
        cost: 80,
        quantity: 0,
    },

    {
        img: "data:image/jpeg;base64,",
        name: "	Streamer Gear Bundle (cam, mic, ring-light, capture card)",
        cost: 80,
        quantity: 0,
    },


    ],


    reducers: {
        incrementAddonQuantity: (state, action) => {
            const item = state[action.payload];
            if (item) {
                item.quantity++;
            }
        },
        decrementAddonQuantity: (state, action) => {
            const item = state[action.payload];
            if (item && item.quantity > 0) {
                item.quantity--;
            }
        },
    },
});

export const { incrementAddonQuantity, decrementAddonQuantity } = AddOnSlice.actions;

export default AddOnSlice.reducer;
